(1158, 'Arthurjab', 'Arthurjab', '123teatr@gmail.com', '<img src=\"https://imom.me/wp-content/uploads/2018/11/man-and-woman1.jpg\"> \r\n \r\n<b>В Telegram-каналах расходится новость</b> (https://t.me/banksta/3705, https://t.me/karaulny_accountant/21904) о том, что сервис для знакомств Tinder дал возможность пользователям хвастаться своими кредитками. \r\nПользователь может указать, кредиткой какого банка пользуется. Также в новости говорится, что тестирование на многотысячной аудитории доказало: <u>наличие банковской карты делает пользователей более привлекательными и сексуальными.</u> \r\n<img src=\"https://smishok.com/uploads/posts/2016-04/thumbs/1460724170_preview-650x341-98-1460715500.jpg\"> \r\n<b>Tinder доказал, что наличие кредитки влияет на сексуальность. </b> \r\n \r\n<u>У части пользователей Tinder появилась новая функция.</u> Приложение предлагает указать, кредитка какого банка лежит у них в кошельке. На выбор представлены кредитные карты лидирующих российских банков: Сбербанка, Альфа-Банка и Тинькофф Банка. \r\nВ Tinder предположили, что наличие кредитной карты может стать значимым фактором, когда решение «нравится/не нравится» надо принять за секунды. Гипотеза подтвердилась: за 2 недели тестирования оказалось, что кредитка работает. Пользователи, которые указали кредитную карту Сбербанка, получили в 1,2 раза больше «сердец» (свайпов вправо), чем пользователи без кредиток. <u>Другими словами, это плюс 20% к привлекательности.</u> \r\n \r\n<u>Обладатели карт Тинькофф Банка проиграли.</u> Сработал стереотип, что владельцы кредиток этого банка имеют небольшие лимиты (10 – 35 тысяч рублей). Действительно, это характеризует человека с определенной стороны. Таким образом конверсия в свайпы вправо оказалось в 1,6 ниже, чем у пользователей без кредиток. Обладатели карт Альфа-Банка выиграли больше других. Конверсия в «сердца» (свайпы вправо) выросла в 4,6 раз, а частота нажатий на «Суперлайк» (аналог супер «сердца») выросла в 8 раз, то есть на 800%. Отсюда можно 