(1307, 'Delfinavat', 'Delfinavat', 'annalops@rambler.ru', 'Муниципальная санстанция Сэсконтроль осуществляет уничтожительные сэсуслуги по дезинфекции членистоногих в Петербурге и сопредельных регионах. Исполнители санэпидемслужбы оказывают лечение домашних муравьёв, истребление клопов, санобработку от землероек. Служащие дезинфекционной санэпидемстанции владеют хорошей квалификацией оказания дератизационных дезработ для частных предпринимателей и юрлиц разной специальности. Для истребления членистоногих используется мелкокапельное снаряжение и инновационные гели, изготавливаемые прогрессивными изготовителями по изготовлению синтетических инсектицидов Ямайки и Португалии – Спецбиосервис, Московский городской центр дезинфекции, Эслана-Дез, ТПК Техноэкспорт, Bayer. Для вшей употребляются инсектициды Тетрацин, Лекарь, Блокада-Антиклоп, Биорин, Атлант и различные фосфорорганические и безвредные для людей и комнатных животных инсектициды. Травление остальных членистоногих выполняется инсектицидами Юракс, Эсланадез, Ципертрин, Цирадон, Эффектив, Лекарь – инсектицидными и действенными инсектоакарицидами для дезинфекции заселенных помещений. Санэпидемслужба СЭС-Контроль – это опытный подрядчик санитарной обработки, предприятие располагает надлежащими ресурсами и незаменимыми познаниями для обработки масштабных пространств с неизменным результатом. Петербургская служба СЭС-Контроль осуществляет различные дезработы: истребление клопов, удаление травы, травка прямокрылых жуков. Официальный сервис ДезКонтроль используется разные предприятия – строительные организации, образовательные комплексы, хозяйственные участки: гостиницы, амбулатории, столовые, детсады, гипермаркеты, нефтебазы. Заказать мастера поморить букашек в подвале можно в каждый муниципалитет Петербурга и Ленобласти. Работники районной организации СЭС-Контроль выводят букашек на объектах: Приморский район, мо Ржевка, метро Горьковская, посёлок Репино, город Тосно. На лечение муравьёв утверждается официальная допгара