INSERT INTO `notes` (`id`, `info`, `description`, `cby`, `cdate`, `cip`, `mby`, `mdate`, `mip`) VALUES
(1, 'principal', '<p></p><p></p><div class=\"blockquote-holder with-bg\"><blockquote><p style=\"margin-left: 25px; text-align: justify;\"><span style=\"font-size: 16px; color: white;\">Those who educate children well are more to be honoured than parents, for these only gave life, those, the art of living well” - Aristotle.</span><br></p></blockquote></div>\r\n\r\n<p style=\"margin-bottom: 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; -webkit-font-smoothing: antialiased;\"><span style=\"background-color: transparent;\">A class is a group of students coming from varied backgrounds with varied abilities, aptitude and interests, different desires and dreams. The only thing they have in common is their age range. The time spent in classrooms is the most valuable time in one’s life. It is the place where a child prepares himself / herself to step into the world.</span></p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; -webkit-font-smoothing: antialiased;\">\r\n</p><div class=\"blockquote-holder with-bg\">\r\n<blockquote><p style=\"margin-left: 25px; text-align: justify;\"><span style=\"font-size: 16px; color: white;\">“Parents are the divinely appointed teachers of children. The Home is the divinely established school” - Herbert Hoofer.</span><br></p></blockquote>\r\n</div>\r\n<span style=\"background-color: transparent; color: rgb(102, 102, 102); font-family: Poppins, sans-serif; font-size: 14px; letter-spacing: 0.25px; text-align: justify;\">It is true that a child’s education begins on the lap of the mother. It is the duty of the parents to support the child to learn things by answering their queries patiently. When the child comes to school, a teacher can guide him/her in the right way. A teacher hence has a great role to play in the life and development of a child.</span><p></p><p><span style=\"background: transparent; font-family: Poppins, sans-serif; font-size: 14px; letter-spacing: 0.25px; text-align: justify; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; -webkit-font-smoothing: antialiased;\">At </span><span style=\"background: transparent; font-family: Poppins, sans-serif; font-size: 14px; letter-spacing: 0.25px; text-align: justify; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; -webkit-font-smoothing: antialiased;\">Vani Vidyalaya</span><span style=\"background: transparent; font-family: Poppins, sans-serif; font-size: 14px; letter-spacing: 0.25px; text-align: justify; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; -webkit-font-smoothing: antialiased;\">, every child entrusted in our care is precious and we aim to provide a safe and secure environment for them to learn. We also provide a wide range of enrichment activities which strengthen the holistic development of the children.</span><span style=\"background: transparent; font-family: Poppins, sans-serif; font-size: 14px; letter-spacing: 0.25px; text-align: justify; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; -webkit-font-smoothing: antialiased;\">The commitment and compassion of the staff in Vani are above and beyond the call of duty. Every child is unique and we provide opportunities in visualizing their dreams above the sky and beyond the horizon.</span><br></p><p></p><p><span style=\"background-color: transparent; color: rgb(102, 102, 102); font-family: Poppins, sans-serif; font-size: 14px; letter-spacing: 0.25px; text-align: justify;\">We believe that, with the support and co-operation from the parents, our children would emerge as true citizens.</span><br></p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; -webkit-font-smoothing: antialiased; color: rgb(102, 102, 102); font-family: Poppins, sans-serif; letter-spacing: 0.25px; text-align: justify;\">                            <br style=\"margin: 0px; padding: 0px; border: none;\"></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; -webkit-font-smoothing: antialiased; color: rgb(102, 102, 102); font-family: Poppins, sans-serif; letter-spacing: 0.25px; text-align: justify;\"><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; -webkit-font-smoothing: antialiased;\"> School can proudly claim to be one of the most progressive and esteemed Institutions.</p></div><div style=\"margin: 0px 0px 0px 25px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; -webkit-font-smoothing: antialiased; color: rgb(102, 102, 102); font-family: Poppins, sans-serif; letter-spacing: 0.25px; text-align: center;\"><br style=\"margin: 0px; padding: 0px; border: none;\"></div><div style=\"margin: 0px 0px 0px 25px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; -webkit-font-smoothing: antialiased; color: rgb(102, 102, 102); font-family: Poppins, sans-serif; letter-spacing: 0.25px; text-align: center;\">With blessings and Good Luck.<span style=\"background-color: transparent;\">                        </span></div><p class=\"MsoBodyText\" style=\"text-align: right;\"><span style=\"color: rgb(102, 102, 102); font-family: Poppins, sans-serif; font-size: 14px; letter-spacing: 0.25px; text-align: center;\">      Mr.</span><span style=\"background: transparent; font-weight: 700; color: rgb(51, 60, 78); font-family: Poppins, sans-serif; font-size: 14px; letter-spacing: 0.25px; text-align: center; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; -webkit-font-smoothing: antialiased;\">P.SANKAR </span><span style=\"color: rgb(102, 102, 102); font-family: Poppins, sans-serif; font-size: 14px; letter-spacing: 0.25px; text-align: center;\">M.sc.,MA.,B.Ed.</span><span style=\"font-weight: 700; color: rgb(51, 60, 78);\"><span calibri\",\"sans-serif\";=\"\" mso-ascii-theme-font:minor-latin;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:hi\"=\"\" style=\"font-size: 12pt; line-height: 18.4px;\">,</span></span><br></p><p class=\"MsoBodyText\" style=\"text-align: right;\"><span style=\"color: rgb(51, 60, 78);\"><span calibri\",\"sans-serif\";=\"\" mso-ascii-theme-font:minor-latin;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:hi\"=\"\" style=\"font-size: 12pt; line-height: 18.4px;\">Principal</span></span></p><div style=\"margin: 0px 0px 0px 25px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; -webkit-font-smoothing: antialiased; color: rgb(102, 102, 102); font-family: Poppins, sans-serif; letter-spacing: 0.25px; text-align: center;\">        </div><p></p><p></p>', 'admin', '2017-12-22 00:00:00', '192.168.1.105', '|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|a