(2, 'chairman', '<div class=\"blockquote-holder with-bg\"><blockquote><p style=\"margin-left: 25px; text-align: justify;\"><span style=\"font-size: 16px; color: white;\">&nbsp; \"ARISE GO FORTH AND CONQUER\"- SWAMJI</span><br></p></blockquote></div><p class=\"MsoBodyText\" style=\"text-align: justify;\">Education makes a man perfect. This has been emphasized by many great people of India and abroad. The all round personality of the child\'s growth depends entirely on proper education. Proper and_ perfect education only makes a child to grow in such a way to live in the Society overcoming any difficulty at any time and he can plan his good future.</p><p class=\"MsoBodyText\" style=\"text-align: justify;\">A flower does not blossom suddenly. A seed must be planted, watered, manured, fenced and cultivated carefully. Only at the end we can enjoy the beautiful flowers. Similarly the character of a child should be</p><p class=\"MsoBodyText\" style=\"text-align: justify;\">Developed slowly and steadily,Shaping the child as a perfect man in the society is the prime motto of the institution<span class=\"Heading9Char\"><span style=\"font-size: 10pt;\">&nbsp;</span></span>&nbsp;\"VANI VIDYALAYA\".</p><p class=\"MsoBodyText\" style=\"text-align: justify;\">This school stands for the educational ideals preached and practiced by Sri Ramakrishna, Swami Vivekananda, Sri Aurobindo, Bharathiar and our ancestors. This school stands in certain ideals, opportunity, discipline and dedication. Well trained and talented teachers have been employed to fulfill the above task.</p><p class=\"MsoBodyText\" style=\"text-align: justify;\">VANI VIDYALAYA is a unit of \"VANI VIDYALAYA EDUCATIONAL CHARITABLE TRUST\" Our Main aim is to create good citizen and Dedicate minded educationalist, scientists and scholars.</p><p class=\"MsoBodyText\" style=\"text-align: justify;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Thanking you,&nbsp; &nbsp; &nbsp;&nbsp;</p><p class=\"MsoBodyText\" style=\"text-align: right;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;In the Service of the National Education</p><p class=\"MsoBodyText\" style=\"text-align: right;\"><span style=\"font-weight: 700; color: rgb(51, 60, 78);\"><span calibri\",\"sans-serif\";=\"\" mso-ascii-theme-font:minor-latin;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:hi\"=\"\" style=\"font-size: 12pt; line-height: 18.4px;\">N.Prakash,</span></span></p><p class=\"MsoNormal\" style=\"margin-left: 25px; text-align: right; line-height: normal;\"><span style=\"text-align: justify;\">Secretary</span></p>', 'admin', '2017-12-22 00:00:00', '192.168.1.105', '|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin|admin', '|2017-12-04-03:51:10|2017-12-04-03:54:00|2017-12-25-11:41:11|2017-12-25-11:41:34|2017-12-25-11:41:56|2017-12-25-11:42:01|2017-12-25-11:42:08|2017-12-25-11:43:05|2017-12-25-11:44:04|2017-12-25-11